import React from "react";
import './index.css';

const SlotM = (props) =>{
    // let x = ":)";
    // let y = ":)";
    // let z = ":)";
    let x= props.x;
    let y= props.y;
    let z= props.z;
    if(x===y && y===z){
        return(
            <>
            <div className="slot_inner">
            <h1>{x} {y} {z}</h1>
            <h1>this is matching</h1>
            </div>
            <hr/>
            </>
        )
    }
    else{
        return(
            <>
            <div className="slot_inner">
            <h1>{x} {y} {z}</h1>
            <h1>this is not matching</h1>
            </div>
            </>
        )

    }
}

const App = () =>{
    return(
        <>

        <h1 className="heading_styles">
         Welcome to <span style= {{color:"red"}}> slot machine game</span> </h1>
        <div className="slotmatchine">
        <SlotM x=':)' y=':)' z=':)'/>
        <hr/>
        <SlotM x=':(' y=':(' z=':('/>
        <hr/>
        <SlotM x=':D' y=':D' z=':D'/>
        </div>

        
        </>
    );
};
export default App;
